import { Table, Tag } from "antd";
import axios from "axios";
import React, { useEffect, useState } from "react";

function Product() {
  const [product, setProduct] = useState([]);

  useEffect(() => {
    axios
      .get("/product?q=rose&limit=25&page=1")
      .then((response) => {
        if (response.status === 200) {
          setProduct(response.data);
        } else {
          console.log("Connect fail");
        }
      })
      .catch(function (error) {
        console.log(error);
      });

    return () => {};
  }, []);

  const conlumn = [
    {
      title: "Name",
      dataIndex: "name",
      key: "name",
    },
    {
      title: "Brand",
      dataIndex: "brand",
      key: "brand",
    },
    {
      title: "Ingredient list",
      key: "tags",
      dataIndex: "ingredient_list",
      render: (tags) => (
        <>
          {tags.map((tag) => {
            let color = tag.length > 5 ? "geekblue" : "green";
            if (tag === "loser") {
              color = "volcano";
            }
            return (
              <Tag color={color} key={tag} className="ingredient-list-table">
                {tag.toUpperCase()}
              </Tag>
            );
          })}
        </>
      ),
    },
    {
      title: "Quality",
      key: "quantity",
      dataIndex: "ingredient_list",
      render: (tags) => <>{tags.length > 50 ? <div>good</div>: <div>false</div>}</>,
    },
  ];
  return (
    <div>
      <Table
        columns={conlumn}
        dataSource={product}
        className="table-product"
      ></Table>
    </div>
  );
}
export default Product;
